# 修复 JSON 格式（加上引号）
# **给所有键补上双引号**
fixed_text = re.sub(r'(?<=\{|,)\s*(\w+):', r'"\1":', text)

# **尝试逐行解析**
try:
    data = json.loads(fixed_text)  # 尝试解析整个 JSON
    print(data)
    with open('修复word.json', 'w', encoding='utf-8') as f:
        f.write(json.dumps(data))
except json.JSONDecodeError as e:
    print("JSON 解析失败:", e)
    error_line = fixed_text.split("\n")[e.lineno - 1]  # 找到错误行
    print(f"❌ 可能的错误行: {error_line}")
